import React from 'react';
import {PropertyTypeDesc, PropertyTypeImg, PropertyTypeProfile} from "./styles";


export const PropertyProfile = () => {
    return (
        <PropertyTypeProfile>
            <PropertyTypeImg>
               <img src="https://randomuser.me/api/portraits/men/46.jpg" alt="img" width="60px" height="60px"/>
            </PropertyTypeImg>
            <PropertyTypeDesc>
                <p  style={{fontWeight: '400', textTransform: 'Capitalize'}}>hi,</p>
                <p style={{fontWeight: '700'}}>yeison estiven guzman</p>
            </PropertyTypeDesc>

        </PropertyTypeProfile>
    );
};
